import turtle

#setup
t = turtle.Turtle()
turtle.bgcolor("white")
turtle.degrees()
turtle.setup(500, 700)
turtle.colormode(255)
turtle.hideturtle()
t.speed(0)
class Shape():
    def __init__(self, positions, color_fill ,outline = "#000000"):
      self.positions = positions
      if type(color_fill) is tuple:
        self.color_fill = (color_fill[0]+30,color_fill[1]+30,color_fill[2]+30)
      else :
        self.color_fill = color_fill
      self.outline = outline
    def fill_shape(self):
        print("shape filled with color :",self.color_fill)
        t.penup()
        t.goto(self.positions[0])
        t.color(self.outline,self.color_fill)
        t.begin_fill()
        t.pendown()
        for i in self.positions:
            t.goto(i)
        t.goto(self.positions[0])
        t.end_fill()
    def draw(self):
        t.penup()
        t.goto(self.positions[0])
        t.color(self.outline)
        t.pendown()
        for i in self.positions:
            t.goto(i)
        t.goto(self.positions[0])


